import './App.css';

function App() {
  return (
    <div className="App">
      <label>Fabric Type:</label>
      <input type="text"/>
      <label>Fabric Color:</label>
      <input type="text"/>
      <label>Yardage:</label>
      <input type="number"/>
      <label>Width:</label>
      <input type="number"/>

    </div>
  );
}

export default App;
